import React, { useState } from "react";
import { FaUser, FaEnvelope, FaSignOutAlt, FaEdit, FaCog, FaShield } from "react-icons/fa";
import "./Profile.css";

const Profile = ({ user, handleLogout }) => {
  const [isLoading, setIsLoading] = useState(false);

  if (!user) {
    return (
      <div className="profile-loading">
        <div className="loading-spinner"></div>
        <p>Loading profile...</p>
      </div>
    );
  }

  const handleLogoutClick = async () => {
    setIsLoading(true);
    try {
      await handleLogout();
    } catch (error) {
      console.error("Logout failed:", error);
    } finally {
      setIsLoading(false);
    }
  };

  return (
    <div className="profile-container">
      <div className="profile-card">
        {/* Header Section */}
        <div className="profile-header">
          <div className="profile-avatar-container">
            <img
              src={user.photo}
              alt="Profile Avatar"
              className="profile-avatar"
              onError={(e) => {
                e.target.src = "https://via.placeholder.com/150/4a90e2/ffffff?text=User";
              }}
            />
            <div className="avatar-overlay">
              <FaEdit className="edit-icon" />
            </div>
          </div>
          
          <div className="profile-info">
            <h1 className="profile-name">{user.name}</h1>
            <p className="profile-email">
              <FaEnvelope className="email-icon" />
              {user.email}
            </p>
          </div>
        </div>

        {/* Stats Section */}
        <div className="profile-stats">
          <div className="stat-item">
            <div className="stat-number">12</div>
            <div className="stat-label">Reports</div>
          </div>
          <div className="stat-divider"></div>
          <div className="stat-item">
            <div className="stat-number">3</div>
            <div className="stat-label">This Month</div>
          </div>
          <div className="stat-divider"></div>
          <div className="stat-item">
            <div className="stat-number">98%</div>
            <div className="stat-label">Accuracy</div>
          </div>
        </div>

        {/* Actions Section */}
        <div className="profile-actions">
          <div className="action-buttons">
            <button className="action-btn secondary">
              <FaCog className="btn-icon" />
              <span>Settings</span>
            </button>
            
            <button className="action-btn secondary">
              <FaShield className="btn-icon" />
              <span>Privacy</span>
            </button>
          </div>

          <button 
            className={`logout-btn ${isLoading ? 'loading' : ''}`}
            onClick={handleLogoutClick}
            disabled={isLoading}
          >
            {isLoading ? (
              <>
                <div className="btn-spinner"></div>
                <span>Logging out...</span>
              </>
            ) : (
              <>
                <FaSignOutAlt className="btn-icon" />
                <span>Logout</span>
              </>
            )}
          </button>
        </div>

        {/* Account Info */}
        <div className="account-info">
          <div className="info-item">
            <FaUser className="info-icon" />
            <div className="info-content">
              <span className="info-label">Member since</span>
              <span className="info-value">January 2025</span>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Profile;
